import { NavLink } from "react-router-dom";
import VacationModel from "../../../Models/VacationModel";
import "./VacationCard.css";

interface VacationCardProps {
    vacation: VacationModel;
}

function VacationCard(props: VacationCardProps): JSX.Element {
    return (
        <div className="VacationCard" style={{backgroundAttachment: `url(http://localhost:3001/api/vacations/images/${props.vacation.imageName})`, bac}}>
            <div>
            {/* <img src={"http://localhost:3001/api/vacations/images/" + props.vacation.imageName} /> */}
                {props.vacation.destination} <br />
                Description: {props.vacation.description} <br />
                Price: {props.vacation.price} <br />
            </div>
            <div>
                    
                <NavLink to={"/vacations/details/" + props.vacation.id}>
                </NavLink>
            </div>
        </div>
    );
}

export default VacationCard;
